const StarRatingTemplate = {
    size: 50,
    count: 5,
    color: "black",
    activeColor: "red",
    value: 7.5,
    a11y: true,
    isHalf: true,

    onChange: newValue => {
      console.log(`Example 2: new value is ${newValue}`);
    }
  };


export default StarRatingTemplate;
